import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { toast } from 'react-toastify';

const Cars = () => {
  const [cars, setCars] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchCars();
  }, []);

  const fetchCars = async () => {
    try {
      setLoading(true);
      const response = await axios.get('/api/cars');
      setCars(response.data);
    } catch (error) {
      console.error('Error fetching cars:', error);
      toast.error('Failed to load cars');
    } finally {
      setLoading(false);
    }
  };

  const handleDelete = async (carId, carName) => {
    if (window.confirm(`Are you sure you want to delete ${carName}? This action cannot be undone.`)) {
      try {
        await axios.delete(`/api/cars/${carId}`);
        setCars(cars.filter(car => car._id !== carId));
        toast.success('Car deleted successfully');
      } catch (error) {
        console.error('Error deleting car:', error);
        toast.error('Failed to delete car');
      }
    }
  };

  const formatDate = (date) => {
    return new Date(date).toLocaleDateString('en-US', {
      year: 'numeric',
      month: 'short',
      day: 'numeric'
    });
  };

  if (loading) {
    return (
      <div className="container mx-auto px-4 py-8">
        <div className="flex items-center justify-center min-h-64">
          <div className="spinner"></div>
        </div>
      </div>
    );
  }

  return (
    <div className="container mx-auto px-4 py-8">
      {/* Header */}
      <div className="flex flex-col sm:flex-row sm:items-center sm:justify-between mb-8">
        <div>
          <h1 className="text-3xl font-bold text-gray-900">My Cars</h1>
          <p className="text-gray-600 mt-2">Manage your car collection</p>
        </div>
        <Link
          to="/cars/add"
          className="btn btn-primary mt-4 sm:mt-0"
        >
          <span>âž•</span>
          Add New Car
        </Link>
      </div>

      {/* Cars Grid */}
      {cars.length === 0 ? (
        <div className="empty-state">
          <div className="empty-state-icon">ðŸš—</div>
          <h3 className="text-lg font-medium text-gray-900 mb-2">No cars yet</h3>
          <p className="text-gray-600 mb-6">Start building your car collection by adding your first vehicle.</p>
          <Link to="/cars/add" className="btn btn-primary">
            Add Your First Car
          </Link>
        </div>
      ) : (
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {cars.map((car) => (
            <div key={car._id} className="card hover:shadow-lg transition-shadow">
              {/* Car Image */}
              <div className="h-48 bg-gray-200 rounded-t-lg flex items-center justify-center">
                {car.image ? (
                  <img
                    src={car.image}
                    alt={`${car.make} ${car.model}`}
                    className="w-full h-full object-cover rounded-t-lg"
                  />
                ) : (
                  <div className="text-6xl text-gray-400">ðŸš—</div>
                )}
              </div>

              {/* Car Details */}
              <div className="card-body">
                <div className="flex items-start justify-between mb-3">
                  <div>
                    <h3 className="text-xl font-semibold text-gray-900">
                      {car.make} {car.model}
                    </h3>
                    <p className="text-gray-600">{car.year}</p>
                  </div>
                  <span className="badge badge-primary">{car.color}</span>
                </div>

                <div className="space-y-2 mb-4">
                  <div className="flex justify-between text-sm">
                    <span className="text-gray-600">License Plate:</span>
                    <span className="font-medium">{car.licensePlate}</span>
                  </div>
                  <div className="flex justify-between text-sm">
                    <span className="text-gray-600">Mileage:</span>
                    <span className="font-medium">{car.mileage.toLocaleString()} miles</span>
                  </div>
                  {car.vin && (
                    <div className="flex justify-between text-sm">
                      <span className="text-gray-600">VIN:</span>
                      <span className="font-medium font-mono text-xs">{car.vin}</span>
                    </div>
                  )}
                </div>

                {car.notes && (
                  <div className="mb-4">
                    <p className="text-sm text-gray-600 line-clamp-2">{car.notes}</p>
                  </div>
                )}

                <div className="text-xs text-gray-500 mb-4">
                  Added {formatDate(car.createdAt)}
                </div>

                {/* Action Buttons */}
                <div className="flex space-x-2">
                  <Link
                    to={`/cars/${car._id}`}
                    className="btn btn-primary btn-sm flex-1"
                  >
                    View Details
                  </Link>
                  <Link
                    to={`/cars/${car._id}/edit`}
                    className="btn btn-outline btn-sm"
                  >
                    Edit
                  </Link>
                  <button
                    onClick={() => handleDelete(car._id, `${car.make} ${car.model}`)}
                    className="btn btn-danger btn-sm"
                  >
                    Delete
                  </button>
                </div>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default Cars;
